branch-defaults:
  master:
    environment: SIA-LoungeAssistantApp-dev
environment-defaults:
  SiaLoungeassistantapp-env:
    branch: master
    repository: SIA-LoungeAssistantApp
global:
  application_name: SIA-LoungeAssistantApp
  default_ec2_keyname: null
  default_platform: arn:aws:elasticbeanstalk:ap-southeast-1::platform/Node.js running
    on 64bit Amazon Linux/4.2.1
  default_region: ap-southeast-1
  include_git_submodules: true
  instance_profile: null
  platform_name: null
  platform_version: null
  profile: eb-cli
  sc: git
  workspace_type: Application
